The conditional statement we can use to execute code if the body of an if statement does not execute is an else statement. An else statement checks a condition following an if statement if and only if the conditional of the if statement was false and the if statement did not execute its body. Say we would like to continue the example from the previous section by having the program do something else since the condition of the if statement is false. x = 10
if ( x > 21 ): print("x is larger than 21")
else: print("x is 21 or smaller") Here an else statement comes directly after the if statement. The else statement's body is print("x is smaller than 21"), and it will execute since the body of the if statement does not. Note that an else statement has no conditional check. However there is technically an implicit condition: that the condition of the if statement is false. Because an else statement will not execute its body if the if statement has already executed its. else The flow from an if statement to an else statement

113.body:
The elif statement - short for else if however, is an else statement with a condition. So it executes its body if the previous if statement did not execute its body AND the elif statement's condition is true. So, where a if-else block can be used 2 possible outcomes, an if-elif-else block can be used for 2 or more possible outcomes. Keep in mind that if the if statement executes its body, nothing else is done. The flow stops at the if statement if it has a true condition. elif The flow from if to elif to else statement x = 19
if ( x > 21 ): print("x is larger than 21")
elif (x > 14): print("x is larger than 14")
else: print("x is 14 or smaller") Here, the value of x is checked twice before the else statement finally executes. This structure could be extended using as many elif statements as necessary.
